import styled from "styled-components";
import Navigation from "../components/Navigation";

const Container = styled.div`
  height: 300vh;
  width: calc(100vw - 20px);

  background-color: aliceblue;
`;

export default function Main() {
  return (
    <Container>
      <Navigation />
    </Container>
  );
}
